  false,\n\t\"url\": null,\n\t\"notes\": \"The focus of the Wahikuli-Honokowai Watershed
  Management Plan is the land use practices and alterations affected in the agricultural
  and urban districts that have upset the natural drainage patterns and ecohydrologic
  balance and services the watersheds provide.  As the approach to reducing the effects
  of land-based sources of pollution, the Wahikuli-Honokowai Watershed Management
  Plan identifies nine priority projects to reduce, capture, and remediate the impacts
  of non-point source pollutants through the implementation of management practices
  in priority areas. The Watershed Management Plan also includes recommendations for
  strategic, long-term trend monitoring of the health of the coral reef ecosystem,
  which provides information that can be correlated to the implementation of solutions
  to reduce land-based non-point source pollutants. nnKahekili Beach Park reef and
  the coastal areas to the north are considered high priority. Corals in this region
  have been severely impacted by land-based pollutants, causing coral dieback and
  reducing coral cover. To fill in the gap, a baseline assessment for  benthic cover
  data (described here) along with coral demographic metrics, has been conducted at
  the mouths of the Mahinahina, Honokowai, and Wahikuli, Kahana, Honokeana, Honokohua,
  and Honolua stream drainages in West Maui, Hawaii,  to track and evaluate the efficacy
  of implemented management practices. The installation of permanent survey transects
  will provide long-term time series to quantify changes in the reef benthic community.
  Sediment flux, and turbidity data are also collected at the  Mahinahina, Honokowai,
  and Wahikuli, dranages (described separately).nnThe data described here were collected
  via line-point-intercept (LPI) and photo quadrat surveys by the NOAA Coral Reef
  Ecosystem Program (CREP) according to established protocols.  These data include:n1)
  an assessment of benthic cover for the selected monitoring sites; andn2) benthic
  photographs to serve as a permanent record of the site.nnData is available for surveys
  conducted in 2014 and 2015.  The LPI data can be accessed online via the NOAA National
  Centers for Environmental Information (NCEI) Ocean Archive, accession #0138585,
  and the benthic photographs are available upon request from CREP.nnAdditionally,
  belt transect surveys of coral demography (adult and juvenile corals) were conducted
  (described separately), and turbidity sensors, sediment traps, and sediment pods
  were deployed by project partners to provide information on sediment loads, sediment
  accumulation rates, and sediment composition. As watershed management projects are
  implemented, changes in sediment and nutrient loading and the resulting impacts
  on the reefs can be monitored over time.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
